import React from 'react';
import { storage } from '../../firebase/index.js'

const PrivateImg = (props) => {
    var storageRef = storage.ref();
    const { _id, url, title, imageName
    } = props.upload
    const handleDelete = (id) => {
        fetch(`http://localhost:3002/deletePrivate/${id}`, {
            method: 'DELETE'
        })
            .then(res => res.json())
            .then(result => {
                alert('deleted')
            })

        var desertRef = storageRef.child(`images/${imageName}`);
        desertRef.delete().then(() => {
            alert('file deleted')
        }).catch((error) => {
            console.log(error);
        });
        window.location.reload(false);
    }
    return (
        <div class="card bg-secondary mx-1 my-1 " style={{ width: '30%' }}>
            <img src={url} class="card-img-top h-50" alt="..." />
            <div class="card-body">
                <h5 class="card-title text-light text-center">{title}</h5>

            </div>
            <div className="card-footer">
                <button onClick={() => handleDelete(_id)} class="btn btn-danger btn-block">Delete</button>
            </div>
        </div>
    );
};

export default PrivateImg;
